import { useNavigate } from "react-router-dom";
import React, { useState, useMemo,useRef } from 'react'
import { Alert } from "react-bootstrap";
import logo1 from "./habit-tracker-gif-looponce.gif";
import "./register-login.css";
import Select from 'react-select'
import countryList from 'react-select-country-list'
export default function Complete() {
    const [value, setValue] = useState('');
    const options = useMemo(() => countryList().getData(), []);
    const [name, setName] = useState("");
    const [country, setCountry] = useState("");
    const [age, setAge] = useState("");
    const [error, setError] = useState("");
    const [loading, setLoading] = useState(false);
    const navigate = useNavigate();

    const nameRef = useRef();
    const countryRef = useRef();
    const ageref = useRef();

    const changeHandler = value => {
        setValue(value);
    };
  async function handleSubmit(e) {
    e.preventDefault();
    if (nameRef.current.value ==="") {
      return setError("donner un nom");
    }
    try {
      setError("");
      setLoading(true); 
      await (nameRef.current.value, countryRef.current.value);
    setName(nameRef.current.value);
    setCountry(countryRef.current.value);
    setAge(ageref.current.value);
      navigate("/Dashboard");
    } catch (error) {
      setError("Failed to continue");
      setError(error.message || "Failed to continue"); 

    }
    setLoading(false);
  }

  return (
    <div className="loginmainContainer">
      <div className="loginmainBody">
        <img className="logo" src={logo1} alt="Habit tracker gif" />
        <h1>Please complete registration </h1>
        {error && <Alert variant="danger">{error}</Alert>}
        <form id="registerForm" onSubmit={handleSubmit}>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required ref={nameRef} />
          <label htmlFor="name">Country</label>
          <Select options={options} value={value} onChange={changeHandler} ref={countryRef} />
          <input disabled={loading} type="submit" id="registerButton" name="registerButton" value="Complete" />
          <label htmlFor="name">Age:</label>
          <input type="number" id="number" name="number" required ref={ageref} />
        </form>
      </div>
    </div>
  );
}
export function Donner({ nameRef, countryRef, ageref }){
return(
    <>
      <div>{nameRef.current ? nameRef.current.value : "No name"}</div>
      <div>{countryRef.current ? countryRef.current.value : "No country"}</div>
      <div>{ageref.current ? ageref.current.value : "No age"}</div>
  </>
);}
